import './FamilySignUpForn.css';
import React, { useState } from 'react';

function FamilySignUpForm() {
  const [isLoginVisible, setLoginVisible] = useState(true);

  const toggleVisibility = () => {
    setLoginVisible(!isLoginVisible);
  };

  return (
    <div className='changingForm'>
      {isLoginVisible ? 
      <div className='the-form login'>Login</div> : 
      <div className='the-form signup'>Signup
      <button onClick={toggleVisibility}>Toggle Visibility</button></div>}
    </div>
  );
};

export default FamilySignUpForm;
